HiTaste P8 HNB e lumellana le IQOS, LIL thupa Litlhaloso tsa Hitaste P8: 1. Boima ba Nete: 98g 2. Skrine sa OLED 3. Bokhoni ba betri: e hahiloeng ho 3200mah 4. Sebopeho sa ho tjhaja: Mofuta oa C 5. Nako ea ho tjhaja: 2 lihora 6. Nako ea ho futhumatsa: metsotsoana e 15 7. Lithupa tsa koae: Marlboro/HEETS 8. Nako ea ho tsuba: metsotsoana ea 180-360 9. Tefiso e felletseng: tšehetsa lithupa tsa koae tse 26pcs(210s 250 ℃) HiTaste P8 hape e ile ea bula sistimi ea ho futhumatsa e habeli (pini ea ho fut
..........
), e khutlisetsang tatso ea lisakerete tse futhumetseng hamolemo.HiTaste P8 e sebelisa betri ea matla a maholo a 3200mAh, e ka tsuba lithupa tse ka bang 25 ha e tjhajetsoe ka botlalo.Ka ponts'o ea OLED, sebaka sa mocheso se ka fetoloa ho tloha ho 200 ° C ho isa ho 300 ° C.Skrine e ka hlahisa palo ea lisakerete, nako ea ho tsuba, le matla a setseng a betri, e leng se ntlafatsang tlhoko ea tšebelisano ea mochini oa batho.Sesebelisoa se nang le skrine se nang le lisebelisoa se fetohile khetho ea me
